import React from "react";

const ErrHandling = ({ err_msg }) => {
  if (err_msg) {
    return (
      <div class="alert alert-danger" role="alert">
        <h3>{err_msg}</h3>
      </div>
    );
  }

  return (
    <div class="alert alert-danger" role="alert">
      <h3>Something went wrong... What have you done?</h3>
    </div>
  );
};

export default ErrHandling;
